import './Table.css';

function Table() {
  return (
    <div>
    <h1>Memo</h1>
    <table>
        <thead>
        <tr>
            <td className="date">Date</td>
            <td className="text">text</td>
            <td>
                <div className='btn'>
                    <button>update</button>
                    <button>Delete</button>
                </div>
            </td>
        </tr>
        </thead>

    </table>
    </div>
  );
}

export default Table;
